import React, {useState} from "react"
import './App.css';
import AllRecipes from "./Components/AllRecipes";
import HighMarginRecipes from "./Components/HighMarginRecipes";
import IsDisabled from "./Components/IsDisabled";
import IsIncorrect from "./Components/IsIncorrect";
import IsUntagged from "./Components/IsUntagged";
import LowMarginRecipes from "./Components/LowMarginRecipes";
import TopFluctuatingRecipes from "./Components/TopFluctuatingRecipes";
import {Tabs, Tab } from "react-bootstrap"
import 'bootstrap/dist/css/bootstrap.min.css'


function App() {

    const [key, setKey] = useState('incorrect');

    return (
        <>
            {/* <div>
                <div>high margin data -<HighMarginRecipes /></div>
                <div>low margin data - <LowMarginRecipes /> </div>
                <div>top fluctuating data - <TopFluctuatingRecipes /> </div>
            </div> */}

            <Tabs className="myTabs" id="controlled-tab-example" activeKey={key} onSelect={(k) => setKey(k)}>
                <Tab eventKey="allrecipes" title="ALL RECIPE(S)">
                    <AllRecipes />
                </Tab>
                <Tab eventKey="incorrect" title="INCORRECT">
                    <IsIncorrect />  
                </Tab>
                <Tab eventKey="untagged" title="UNTAGGED">
                    <IsUntagged />
                </Tab>
                <Tab eventKey="disabled" title="DISABLED">
                    <IsDisabled />
                </Tab>
            </Tabs>
        </>
    );
}

export default App;
